/*Table structure for table `hrk_sf_airports` */

DROP TABLE IF EXISTS `hrk_sf_airports`;

CREATE TABLE `hrk_sf_airports` (
  `aid` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'The primary identifier for a airport code.',
  `cid` int(10) unsigned NOT NULL DEFAULT '0' COMMENT 'The current hrk_sf_countries.id identifier.',
  `ctid` int(10) unsigned NOT NULL DEFAULT '0' COMMENT 'The current hrk_sf_cities.id identifier.',
  `code` varchar(3) NOT NULL DEFAULT '' COMMENT 'The city code.',
  `name_en` varchar(255) NOT NULL DEFAULT '' COMMENT 'The city en name.',
  `name_ru` varchar(255) NOT NULL DEFAULT '' COMMENT 'The city ru name.',
  PRIMARY KEY (`aid`)
) ENGINE=InnoDB AUTO_INCREMENT=9453 DEFAULT CHARSET=utf8 COMMENT='The base table for airports.';

